height:200px;
`;

const Left=styled.div`


`;

const HomeContent = () => {
  return (
    <div>
    <Container>
      <Left>
    <Image src="images/logo.jpg"></Image>
    </Left>
    <Right>

    </Right>
    </Container>
    </div>
  );
}

export default HomeContent;
